Here is a simple implementation of a linked list and a function to reverse it:

```
class Node:
    def __init__(self, data):
        self.data = data 
        self.next = None 

class LinkedList:
    def __init__(self):
        self.head = None

    def append(self, data):
        if not self.head:
            self.head = Node(data)
        else:
            current = self.head 
            while current.next:
                current = current.next 
            current.next = Node(data)

    def display(self):
        elements = []
        current_node = self.head 
        while current_node:
            elements.append(current_node.data) 
            current_node = current_node.next 
        return elements

    def reverse(self):
        prev = None 
        current = self.head 
        while current:
            nxt = current.next 
            current.next = prev 
            prev = current 
            current = nxt 
        self.head = prev

# Test the code 
llist = LinkedList()
for i in range(1, 6):
    llist.append(i)

print("Original List: ", llist.display())
llist.reverse()
print("Reversed List: ", llist.display())
```

